webpackJsonp([0x8640bd0035b6],{1167:function(e,t){e.exports={data:{markdownRemark:{html:'<p>WOOT!!! After about 20 hours worth of work (and several weeks worth of having to put it off), I am excited to say that my February design challenge: a JavaScript calculator is finally done! I used jQuery and the BigNumber JS library to make it all happen. If you’ve read any of my previous FCC project write ups, you already know it wasn’t all roses and wedding cake. Let me give a quick summary of some of the major issues I grappled with.</p>\n<h2>A Caveat and Idea For Next Time</h2>\n<p>I tried so hard to be conscientious during this process of showing my work, so I took screenshots at various design stages, but even though I only completed the project in the last 2 days, I found this post really, surprisingly hard to write as the remembrance of problems solved faded away quickly. I’ve tried my best to recall my pathway and forks in the road in a coherent fashion, but feel free to ask me questions if any of this doesn’t make sense.</p>\n<h2>Sticking Points</h2>\n<h3>Saving the Total</h3>\n<figure>\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 672px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 32.589285714285715%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAAHCAYAAAAIy204AAAACXBIWXMAAAsSAAALEgHS3X78AAAAYElEQVQoz62OSwrAIAxEvf9FPYGajzp1lEoXXWbgwSToIynnDPeO3g/uvvn2v/ndkTEGmDknUikFRFWhZmitbYxd5M4UyJprrXvPLusP31F6hQgKZUxiieBeGC5EcMKFD8FMKwSUodzfAAAAAElFTkSuQmCC&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="calculator prototype" title="" src="/static/Screen-Shot-2016-02-02-at-4.54.25-PM-a5297174e0b7ac1d8f835c8f1d60130d-2eb95.png" srcset="/static/Screen-Shot-2016-02-02-at-4.54.25-PM-a5297174e0b7ac1d8f835c8f1d60130d-d1e7e.png 203w,\n/static/Screen-Shot-2016-02-02-at-4.54.25-PM-a5297174e0b7ac1d8f835c8f1d60130d-fd525.png 405w,\n/static/Screen-Shot-2016-02-02-at-4.54.25-PM-a5297174e0b7ac1d8f835c8f1d60130d-2eb95.png 672w" sizes="(max-width: 672px) 100vw, 672px">\n    </span>\n  </span>\n  \n  <figcaption>A reasonable facsimile of my original prototype. Ugly, huh?</figcaption>\n</figure>\n<p>This project took shape WAAAAAY more quickly than I thought it would. By the time I sat down to code, I’d thought through how the calculator should work. So I was able to get a super ugly basic prototype working within a couple of hours (I’m super proud of myself. Can you tell?). But as I was working with the basic display and buttons I’d created, I noticed that the result of the calculations wasn’t being saved properly. I began, as you might expect, with a total variable. At certain times (such as when the equal button was clicked), I needed to clear this total variable, but at the same time, I needed to be able to use that total in subsequent operations. But I couldn’t get it to function properly. What was happening was that the total couldn’t handle more than one operation. If I tried to perform 3+6+7+8, I was running into issues. After another hour or two, I tried out the idea of using an array instead. So I traded out my number variable for pushing in numbers to the array. This seemed to be a better design decision, as I could use the array structure with a for loop that returned a + b. The problem with that, however, was that, with the structure constantly pushing in new numbers, I wasn’t able to perform the operations such that they ONLY happened with the total of the previous operation and the newly pushed number. For example, a+b was, as you would expect, adding up all of the numbers in the array. What I needed was an array that stored the total of the last operation, ready for a new number so that it could perform the next operation. After another about another half-hour, I finally remembered the reduce method, so I switched out my a+ b for loop for numArray.reduce(prev, next). This, along with some refactoring of my operations functions (I split them out so that each operation had its own function) and the equal function (I began to use it to call the separated operation functions) allowed me to finally get to a place where I could perform any number of operations appropriately, including clicking equal and still being able to apply operations to the total.</p>\n<h2>Getting Text Out of Paragraph Tags</h2>\n<p>The basics of the functions worked out, I started to do some styling. I added a history feature so that a user could keep tabs on what operations were happening.</p>\n<figure>\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 810px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 71.84466019417476%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="calculator prototype" title="" src="/static/Screen-Shot-2016-01-31-at-9.31.28-PM-dffffc9ef8d255bb703986fe4a1bc9be-1626e.png" srcset="/static/Screen-Shot-2016-01-31-at-9.31.28-PM-dffffc9ef8d255bb703986fe4a1bc9be-076ec.png 203w,\n/static/Screen-Shot-2016-01-31-at-9.31.28-PM-dffffc9ef8d255bb703986fe4a1bc9be-7ae34.png 405w,\n/static/Screen-Shot-2016-01-31-at-9.31.28-PM-dffffc9ef8d255bb703986fe4a1bc9be-1626e.png 810w,\n/static/Screen-Shot-2016-01-31-at-9.31.28-PM-dffffc9ef8d255bb703986fe4a1bc9be-a12cf.png 1030w" sizes="(max-width: 810px) 100vw, 810px">\n    </span>\n  </span>\n  \n  <figcaption>Second iteration</figcaption>\n</figure>\n<p>Things were going well and I wanted to add some space between the text in each display box and the edge. So I redefined my display functions to concatenate the number strings with opening and closing paragraph tags.   That was simple enough, but then I found that I couldn’t grab the text out of the paragraph tags to turn into numbers to use. This seems like it should have been a simple task, but even when I created a variable to store the div and paragraph:</p>\n<pre><code class="language-javascript">$displayP = $(".display p");\n</code></pre>\n<p>trying to set the html for that would not work:</p>\n<pre><code class="language-javascript">$displayP.html()\n</code></pre>\n<p>In hindsight, maybe this didn’t work because I was dynamically add paragraph tags? At any rate, I reworked it to use:</p>\n<pre><code class="language-javascript">$display = $(".display")\n</code></pre>\n<pre><code class="language-javascript">$display.children().html();\n</code></pre>\n<p>That allowed me to put in some padding and even eventually implement a function to size the font if a ridiculous amount of numbers were input.</p>\n<h2>Performing Operations with Equal</h2>\n<p>Another thing that popped up after I had “fixed” my total problem was that hitting equal and again and again would repeat the last operation. My code had the operation stored in a variable and that variable was used in my equal function in a series of if/else statements to tell which code block to run. What had been happening was that, if I put in a series of operations:</p>\n<pre><code>450 + 20 / 2\n</code></pre>\n<p>my code would skip out on the addition function (because it wouldn’t run without the second number in the array) and only perform the division function. So I tried calling the equal function with every operation, but that resulted in my array being cleared and every new operation starting from 0. I struggled a bit with this one because I really had to get my head around how to  allow equal to perform the last operation while also calling equal for the intermediate operations. Two things helped me get over this hump:</p>\n<ul>\n<li>Firstly, I moved the operations functions outside of the equal function and made them each separate (as I wrote earlier).</li>\n<li>The second thing is that I refactored the functions so that they wouldn’t call equal at all; instead, equal would call them. That meant that I wasn’t clearing my array before I could use what was in it.</li>\n</ul>\n<pre><code class="language-javascript">//Equal calls the last operation performed\nfunction equal() {\n console.log(operation);\n if (operation === "plus") {\n add();\n } else if (operation === "minus") {\n subtract();\n } else if (operation === "multiply") {\n multiply();\n } else if (operation === "divide") {\n divide();\n } else if (operation === "percent") {\n percent();\n }\n operation = "";\n numArray = [];\n}\n</code></pre>\n<h2>Getting Rid of NaN</h2>\n<p>My last big issue (that I know of!) was that, if you clicked on an operator before having put any text it, my code returned NaN. This happened because I grab my numbers from the text on the screen and, I begin the clear state with an empty array and no text on the screen. I did it this way because, my script is set up to check how long the number array is and perform the operation only if there is more than 1 number in the array (so that reduce works appropriately). I tried several times to work around this by adding in another check for whether or not my numArray was empty, but because the equal function clears the numArray, that wouldn’t work. Adding a 0 to the initial numArray initialization didn’t work for the same reason. I toyed with the idea of adding an initial 0 to the display div, but I couldn’t quite get that to work either. In the end, I had to check instead whether or not the text I was grabbing from (remember $display.children.htmL()?) was undefined and, if so, adding a 0 to the numArray.</p>\n<pre><code class="language-javascript">if ($display.children().html() !== undefined) {\n var bigNum = new BigNumber($display.children().html());\n numArray.push(bigNum.toNumber());\n } else {\n numArray.push(0);\n }\n</code></pre>\n<h3>BigNumber JS</h3>\n<p>What’s with the BigNumber? Well, as I wrote at the beginning, I implemented the <a href="https://github.com/MikeMcl/bignumber.js/">BigNumber library</a> in this code. I’ve never forgotten, <a href="/blog/look-ma-im-learnin-freecodecamp-exact-change-bonfire/">from previous experimentations</a>, the trouble you can get into with floating point numbers in JavaScript. So going in, I knew I wanted some way to try and control any issues that might arise with performing calculation with decimal numbers. I’ve used BigNumber to round off decimal points and to shorten extremely long numbers with exponent notation.</p>\n<h2>New Design</h2>\n<p>Not an issue exactly, but I found that I HATED the visual design of my second iteration. So I looked through Dribbble and the calculators that had been designed for the 100-day Daily UI Challenge and took my inspiration from this:</p>\n<figure>\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Original Dribbble Shot" title="" src="/static/4-daily-ui-29b7ade05b65d8e2feaccea334285139-dc451.png" srcset="/static/4-daily-ui-29b7ade05b65d8e2feaccea334285139-09bd2.png 203w,\n/static/4-daily-ui-29b7ade05b65d8e2feaccea334285139-dfc90.png 405w,\n/static/4-daily-ui-29b7ade05b65d8e2feaccea334285139-dc451.png 800w" sizes="(max-width: 800px) 100vw, 800px">\n    </span>\n  </span>\n  \n  <figcaption>[Dribbble shot by&#xA0;Shabbir Manpurwala](https://dribbble.com/shots/2496666--4-Daily-UI-Calculator)</figcaption>\n</figure>\n<figure>\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 789px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 73.25728770595691%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="My final calculator UI" title="" src="/static/Screen-Shot-2016-02-02-at-4.41.12-PM-bf05d65855a4cec399adb84bb24d5573-e3029.png" srcset="/static/Screen-Shot-2016-02-02-at-4.41.12-PM-bf05d65855a4cec399adb84bb24d5573-19372.png 203w,\n/static/Screen-Shot-2016-02-02-at-4.41.12-PM-bf05d65855a4cec399adb84bb24d5573-83489.png 405w,\n/static/Screen-Shot-2016-02-02-at-4.41.12-PM-bf05d65855a4cec399adb84bb24d5573-e3029.png 789w" sizes="(max-width: 789px) 100vw, 789px">\n    </span>\n  </span>\n  \n  <figcaption>My Attempt</figcaption>\n</figure>\n<h2>Possible Remaining Issues</h2>\n<p>One thing that I do know is that BigNumber wants to throw an error whenever there are more than 15 major numbers in any given number. I turned errors off, but I’m sure that big calculations could be an issue. I also implemented a font sizing function to try and deal with issues of large amounts of numbers being put in, however, I haven’t tested it with every possible case, so numbers may possibly still spill out.</p>\n<h2>Give it a Spin</h2>\n<p>With all that out of the way, feel free to give it a test drive and let me know what you think!</p>\n<figure>\n  <a href="http://codepen.io/anthkris/full/vLdgev/" target="blank">\n    \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 810px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 50.2834008097166%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Try out the calculators" title="" src="/static/Screen-Shot-2016-02-01-at-7.07.33-PM-f79ad7cd919664f7a54bcb2ec7b3145a-1626e.png" srcset="/static/Screen-Shot-2016-02-01-at-7.07.33-PM-f79ad7cd919664f7a54bcb2ec7b3145a-076ec.png 203w,\n/static/Screen-Shot-2016-02-01-at-7.07.33-PM-f79ad7cd919664f7a54bcb2ec7b3145a-7ae34.png 405w,\n/static/Screen-Shot-2016-02-01-at-7.07.33-PM-f79ad7cd919664f7a54bcb2ec7b3145a-1626e.png 810w,\n/static/Screen-Shot-2016-02-01-at-7.07.33-PM-f79ad7cd919664f7a54bcb2ec7b3145a-9af38.png 1215w,\n/static/Screen-Shot-2016-02-01-at-7.07.33-PM-f79ad7cd919664f7a54bcb2ec7b3145a-03d88.png 1620w,\n/static/Screen-Shot-2016-02-01-at-7.07.33-PM-f79ad7cd919664f7a54bcb2ec7b3145a-ca085.png 2430w,\n/static/Screen-Shot-2016-02-01-at-7.07.33-PM-f79ad7cd919664f7a54bcb2ec7b3145a-137ed.png 2470w" sizes="(max-width: 810px) 100vw, 810px">\n    </span>\n  </span>\n  \n  </a>\n  <figcaption>FCC Calculator in CodePen</figcaption>\n</figure>',frontmatter:{date:"February 09, 2016",path:"/blog/free-code-camp-calculator",title:"Free Code Camp Calculator",tags:["calculator","free code camp","JavaScript"],categories:["Coding","Design","GDS Challenge","Showing my Work"],featured:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:2,src:"/static/JS-Calculator-2b0a7e7fadd6a24cdb56c4f569d3499e-81d39.png",srcSet:"/static/JS-Calculator-2b0a7e7fadd6a24cdb56c4f569d3499e-9a8d1.png 203w,\n/static/JS-Calculator-2b0a7e7fadd6a24cdb56c4f569d3499e-c53f9.png 405w,\n/static/JS-Calculator-2b0a7e7fadd6a24cdb56c4f569d3499e-81d39.png 810w,\n/static/JS-Calculator-2b0a7e7fadd6a24cdb56c4f569d3499e-fda19.png 1024w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
